import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Home from './pages/Home';
import SaibaMais from './pages/SaibaMais';

function Routes() {

    const Date = [
        {
            Titulo: 'Profissional',
            Icone: '',
            Texto: '',
            preco: 29.99

        },
        {
            Titulo: 'Reguladores',
            Icone: '',
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Socio Ambiental',
            Icone: '',
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
        {
            Titulo: 'Juridico',
            Icone: '',
            Texto: 'O aplicativo Balanço Patrimonial realiza a consulta de todos os balanços que são publicados nos Diários Oficiais de empresa S.A., de capital aberto e limitados (LTDA) de grande porte.',
            preco: 29.99

        },
    ]


    return (
        <BrowserRouter>
            <Switch>
                <Route path="/" component={Home} exact />
                <Route path="/Saiba-mais" component={SaibaMais} />
            </Switch>
        </BrowserRouter>
    )
}

export default Routes;
